import './Header.css';
import Button from './common/Button';

function Header() {
  return (
    <div className="header">
        <h1 className="header__title">Список заказов</h1>
        <Button 
          buttonClassName="button-large_transparent"
          buttonIconClassName="button__icon-visible"
          buttonText="Светлая тема"
          buttonIconPath="M 14,3.5 V 2 H 12.5 L 11,3.5 12.5,5 Z M 3.5,14 H 2 V 12.5 L 3.5,11 5,12.5 Z M 2,3.5 V 2 H 3.5 L 5,3.5 3.5,5 Z M 12.5,14 H 14 V 12.5 L 12.5,11 11,12.5 Z M 7,1 8,0 9,1 V 3 H 7 Z m 0,14 1,1 1,-1 V 13 H 7 Z M 1,9 0,8 1,7 H 3 V 9 Z M 15,9 16,8 15,7 H 13 V 9 Z M 12,8 A 4,4 0 0 1 8,12 4,4 0 0 1 4,8 4,4 0 0 1 8,4 4,4 0 0 1 12,8 Z"
          buttonIconFill="#459DF5"
        ></Button>
    </div>
  );
}

export default Header;
